import React from 'react';


function ButtonScrollDownUp (props){
    
    return(
           
            <div 
                className={props.classname}
                onClick={() => props.onclick()}
            >   
            
                    {props.nameButton}
                      
            </div>
    )
}

export default ButtonScrollDownUp


